import React from 'react';

const Card = () => {
  return (
    <div>
      <img
        alt="robot image"
        src="https://robohash.org/set_set3/bgset_bg1/3.14159?size=500x500"
      />
      <div>
        <h2>Name</h2>
        <p>Email</p>
      </div>
    </div>
  );
};

export default Card;
